

def custom_sort(t, s):
    q, q2 = [], []
    for char in s:
        if char in t:
            q.insert(0, char)
        else:
            q2.insert(0, char)
    q = "".join(sorted(q, key=t.index))
    q2 = "".join(sorted(q2))
    return q + q2


class Test:
    def assert_equals(a, b):
        try:
            assert a == b
        except AssertionError:
            print(f"{a}\n > should equal \n\t{b}")


TestsConsoleTest = Test


